INSERT INTO `dock_stop_class` VALUES (0, '正常区间 | Rentang normal', 0, NULL, 'Rentang normal', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (1, '皮带机或者门机、卸船机等设备损坏', 0, 1, 'Kerusakan belt conveyor, gantry crane, atau unloader', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (2, '清舱时挖机或者铲车等机具不足，或者司机不作为', 0, 0, 'Kurangnya excavator atau loader saat pembersihan palka, atau operator tidak bekerja', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (5, '管理员监督不到位，调舱不合理，造成重点舱', 0, NULL, 'Pengawasan dan penyesuaian palka buruk', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (6, '舱内MMP员工懒散，人手不足', 0, NULL, 'Karyawan MMP di dalam palka malas, tenaga kerja kurang', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (7, '码头员工人手不足或者懒散', 0, NULL, 'Karyawan dermaga kurang atau malas', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (8, '门机司机问题，如不作为、懒散、技术不好等，作业慢', 0, NULL, 'Operator gantry crane lambat', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (9, '因舱内被挖机、叉车或者铲车等碰坏，需要维修，导致延迟离港', 0, NULL, 'Terlambat berangkat karena kerusakan palka oleh alat berat', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (10, '因舱内未按照配载装货导致的问题，船方要求暂停作业', 0, NULL, 'Pemuatan tidak sesuai, kapal minta berhenti', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (11, '清理装船机溜槽', 0, NULL, 'Bersihkan corong ship loader', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (12, '布料车移动位置', 0, NULL, 'Pindahkan truk penyalur', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (14, '下雨或者风太大，无法作业', 1, NULL, 'Hujan atau angin kencang, tidak bisa kerja', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (15, '自然灾害，如地震，海啸，飓风，无法作业', 1, NULL, 'Bencana alam, tidak bisa kerja', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (16, '涌浪太大，船舶晃动厉害，无法作业', 1, NULL, 'Gelombang besar, kapal goyang, tidak bisa kerja', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (17, '船方原因，如无法开舱，不愿开舱，船东不同意开舱，无法作业', 1, NULL, 'Alasan kapal, tidak bisa buka palka', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (18, '上下游公司或者单位导的车辆不足或者场地不足，无法作业', 1, NULL, 'Kendaraan atau lahan hulu-hilir kurang', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (19, '上下游公司或者单位和船方沟通问题，导致无法作业', 1, NULL, 'Masalah komunikasi hulu-hilir dan kapal', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (20, '港务和引水员迟到，导致延迟离港', 1, NULL, 'Petugas pelabuhan/pilot terlambat', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (21, '船方原因，如关舱问题，清理舱内卫生等，导致延迟离港', 1, NULL, 'Alasan kapal, penutupan/bersih palka', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (22, '港务和引水员迟到，导致延迟离港', 1, NULL, 'Petugas pelabuhan/pilot terlambat', NULL, NULL);
INSERT INTO `dock_stop_class` VALUES (23, '船舶证件不全，需补办手续；海关检查延误，影响离港时间。', 1, NULL, 'Dokumen kapal kurang atau tertahan bea cukai', NULL, NULL);
