-- ----------------------------
-- Table structure for dock_plan
-- ----------------------------
DROP TABLE IF EXISTS `dock_plan`;
CREATE TABLE `dock_plan`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '计划单主键',
  `ship_rade` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '内/外贸船',
  `ship_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '船名',
  `imo` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '国际海事组织',
  `ship_length` decimal(10, 2) NULL DEFAULT NULL COMMENT '船长度(米)',
  `usage_unit` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '使用单位',
  `material_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '物料名称',
  `tonnage` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '实际（吨/件）',
  `plan_tonnage` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '计划（吨/件）',
  `remaining_weight` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '剩余重量（最新版已废弃）',
  `update_weight_time` datetime NULL DEFAULT NULL COMMENT '填写剩余重量时间（最新版已废弃）',
  `unload_weight` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '已作业量(吨/件)',
  `hb_id` bigint NULL DEFAULT NULL COMMENT '泊位主键',
  `hb_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '泊位名称',
  `package_num` int NULL DEFAULT NULL COMMENT '按吨计，按件计标识',
  `status` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '状态（0计划 1在途  2等泊 3靠泊 4在装卸 5待离泊 6待离港 7完成 8移泊 ）',
  `unload_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '卸货状态（0未卸货 1正在卸货 2卸货完成）',
  `is_archived` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '是否归档（0否 1是）',
  `archived_month` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '归档月份',
  `screen_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '大屏状态（0显示 1不显示）',
  `reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '等泊原因',
  `last_port` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '上一港',
  `next_port` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '下一港',
  `ship_agency` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '船代理公司',
  `mine_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '矿号',
  `draft` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '水尺',
  `order_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '请购单号',
  `contract_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合同号',
  `suplier_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '供应商名称',
  `batch_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '批次',
  `weight` decimal(10, 2) NULL DEFAULT NULL COMMENT '总吨（重量）',
  `card_count` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '卡数',
  `docking_time` datetime NULL DEFAULT NULL COMMENT '靠泊时间',
  `plan_docking_time` datetime NULL DEFAULT NULL COMMENT '计划靠泊时间',
  `operation_time` datetime NULL DEFAULT NULL COMMENT '作业时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `leave_time` datetime NULL DEFAULT NULL COMMENT '离港时间',
  `arrival_time` datetime NULL DEFAULT NULL COMMENT '到港日期',
  `departure_time` datetime NULL DEFAULT NULL COMMENT '离上港时间',
  `plan_time` datetime NULL DEFAULT NULL COMMENT '计划时间',
  `out_berth_time` datetime NULL DEFAULT NULL COMMENT '离泊时间',
  `move_berth_time` datetime NULL DEFAULT NULL COMMENT '移泊时间',
  `inspection_company` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '检测公司',
  `loading_port` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '装货港',
  `effective_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '有效时间',
  `effective_rate` decimal(10, 2) NULL DEFAULT NULL COMMENT '有效卸率',
  `avg_discharge_rate` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '平均卸率',
  `demurrage_fee` decimal(10, 2) NULL DEFAULT NULL COMMENT '滞期费',
  `contract_rate` decimal(10, 2) NULL DEFAULT NULL COMMENT '合同卸率/天',
  `contract_fee` decimal(10, 2) NULL DEFAULT NULL COMMENT '合同费率/天',
  `plc_real_time` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '实时重量（PLC T/H）',
  `plc_sum_weight` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '累计重量（PLC/H）',
  `plan_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '计划单类型（1滞期 2速遣）',
  `handled_by` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '合同执行人员',
  `del_flag` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '删除状态(0未删除 1已删除)',
  `user_id` bigint NULL DEFAULT NULL COMMENT '用户id',
  `create_by` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `dept_id` bigint NULL DEFAULT NULL COMMENT '部门ID',
  `update_by` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '更新人',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `remark01` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '作业类型（装货，卸货）',
  `remark02` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '是否有多种货物（大于1种），空值表示只有一种货物，非空值表示多种货物',
  `remark03` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '【已废弃】第一种物料是否装卸完毕(0/null未，1已)',
  `source_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '来源（0新增 1导入 2 移泊）',
  `source_id` bigint NULL DEFAULT NULL COMMENT '源单主键',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 25116 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '计划单' ROW_FORMAT = DYNAMIC;

